import React from "react";
import Button from "../UI/Button/Button";
import "./CSS/Modal.css";

const Modal = (props) => {
  return (
    <div className='modal'>
      <p>{props.text}</p>
      <Button className="alt" onClick={props.onClose}>
        Cancel
      </Button>
      <Button onClick={props.onClose}>
        Confirm
      </Button>
    </div>
  );
};
export default Modal;
